import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import styled from "styled-components";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";

function UnitCard(props) {
  //const { card, unit } = props;

  const numberWithCommas = (x) => {
    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
  };

  console.log(props);

  return (
    <Card sx={{ maxWidth: 345 }}>
      <CardMedia
        component="img"
        height="140"
        image=".../public/ocean-mansion.png"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          <h3>Description: {props.unit_description}</h3>
        </Typography>
        <Typography variant="body2" color="text.secondary"></Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}

UnitCard.propTypes = {
  num_of_bedrooms: PropTypes.number.isRequired,
  num_of_bathrooms: PropTypes.number.isRequired,
  num_of_balcony: PropTypes.number.isRequired,
  is_available: PropTypes.bool.isRequired,
  is_reserved: PropTypes.bool.isRequired,
  unit_availability_start_date: PropTypes.string.isRequired,
  unit_availability_end_date: PropTypes.string.isRequired,
  unit_description: PropTypes.string.isRequired,
  living_area_sf: PropTypes.number.isRequired,
  unit_number: PropTypes.number.isRequired,
  unit_at_floor: PropTypes.number.isRequired,
};

export default UnitCard;
